data.text:
@FAcharki Hej, då kan det ha ändrats nyligen. Jag rekommenderar att du kontaktar oss på livechatt eller telefon imorgon mellan kl 08:00-17:00 så kan vi undersöka detta närmre med EuroBonus när de är på plats igen imorgon.

Med vänlig hälsning,
Anton.

@Willdelete12345 Hi! Breast pumps are not considered a medical device but you can bring this in your carry-on baggage. If battery powered we recommend removing the batteries and tape them in a way so that they cannot short-circuit.

Best regards,
Anton.

@plantzombie666 Hi! We don't mind if you want to eat smarties or any other type of candy/snacks on the airplane. For liquids in the carry-on though there are a few restrictions, more info about this can be found on our website https://t.co/2UUXPRN2w1

Best regards,
Anton.

@jhhasselberg Hi! 

Boeing 737-700, and 737-800 are used on European and Intra Scandinavian routes. The Boeing fleet is expected to be faced out by the end of 2022.

//Best regards, Dennis.

@HGeaves Hi, I am sorry to hear that your bag was delayed. If you haven't registered your bag at the airport, please do so here: https://t.co/uHX1YFCLU3 or call here: https://t.co/We1FdD7ZiM
Once registered, you can track your bag here: https://t.co/2zwsPbhQFU
Kind regards, Rebecka

@LBA1403 Hej! Vi kan kika på hur mycket bagage du får ha med dig på din bokning över Live Chatt, Facebook Messenger eller telefon, kontakta oss så hjälper vi dig med detta!
https://t.co/cIkJt9kPnF
Vänliga hälsningar, Rebecka

@sedisturbed Hi! 

Okay, yes it sounds a little weird that it didn't get cancelled correctly. But the best i can recommend is to contact our chat/messenger or customer service by phone so we can have a closer look at what happened. 

//Best regards, Dennis.

@oscarbacalao Hi! 

I'm sorry if your flight was cancelled, and i hope you got through to our customer service in the end so we could help you fix your ticket. 

//Best regards, Dennis.

@MellquistBjorn Hi! 

They should not need anything special but i recommend that you check that with the US embassy as well just to make sure they don't need anything from their end.

//Best regards, Dennis.

@pez944 Hi! 

I'm sorry that your flight was cancelled and if you were stranded at the airport due to that cancellation. But the best i can recommend in that case is to wait until an agent at customer care responds to your claim.

//Best regards, Dennis.

@TheJazzerMurphy Hi! 

I'm sorry to see that one of you didn't get his/her passport in time. But i hope you were able to get through on the phone so we could help you.

//Best regards, Dennis.

@HenriParvi Hello! If the booking is purchased through us, I recommend that you contact us first so we can help you to add the special luggage. In some cases, if you wish to add special luggage that Lufthansa charges for, it needs to be added by them.

Warm regards,
Jenny

@karlsutcliffe We are very sorry for the inconvenience. For help with your compensation claim, please contact our customer service so that we can help you. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@mbp_phillips To know the exact location of the check in desks, please ask one of the staff at the airport for guidance. Check in use to open between 2-4 hours before the departure but it can differ from different airports.

Warm regards,
Jenny

@Netzih Hello! If there is no ticket number or SAS reference in your booking confirmation, please contact the partner airline so they can give you our SAS reference.

Warm regards,
Jenny

@karlsutcliffe Hello! For support with your questions, please contact our customer service and we will be able to answer your questions. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@mbp_phillips Hello! Our bag drops should be located in the landside T1 Departure Hall. The Departure Hall can be reached through either the large double doors at the front of the hall and the skylink walkways.

Warm regards,
Jenny

@kakerlakker Hej! Vi godkänner tyvärr endast katter och hundar på våra flyg. För transport av andra djur behöver ni kontakta SAS cargo. Mer information om SAS cargo finns att hitta här: https://t.co/d7yQGapGtm

Med vänliga hälsningar,
Jenny

@CMBettridge Hello! Mostly that depends on the airport but the estimated time when the bag drop opens for a flight is 2-4 hours before departure.

Warm regards,
Jenny

@Britanthrope Hello! There are flights in december between svalbard and Oslo but they mostly stop in another city to pick up more passengers. Though there is no shifting of plane on the intermediate landing.

Warm regards,
Jenny

@bbananas75 Hello! We recommend that you contact our customer service by phone or live chat so that we can help you with your case. Our contact information is to be found here: https://t.co/BlgfvicYhk

Warm regards,
Jenny

@miketheyokel Hi, I am sorry to hear that your snowboard bags are delayed. If you have already made a report for delayed baggage you can trace your bags online at https://t.co/2zwsPbhQFU - for support you can contact baggage service https://t.co/ZV9bTO3uo2

Best regards,
Anton.

@lvikstrom Hello, please contact us on FB Messenger or livechat https://t.co/b3QIqPk7bj and we can help you take a look at this.

Best regards,
Anton.

@cheapsuperman Hi, I'm sorry to hear that your pre-booked seat was changed. If you wish to send us feedback regarding this, please use our feedback form at https://t.co/Ni77XOBAk2

Best regards,
Anton.

@KontisP Hello!
As a Star Alliance Gold member, you can take an extra 20 kg (44 pounds) where the weight concept applies or an extra piece where the piece concept applies. This applies to most tickets, you will find the exceptions here: https://t.co/rhdSy8H4f1 

Regards, Anja!

@speakchristina Hello and welcome! I recommend that you contact our customer service so we can help you to add the seats. Our contact information can be found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@Richard50640690 Okay, sadly we cannot assist you with this case here over Twitter but if you contact us on livechat with your Case ID we can send a reminder to Customer Care for you https://t.co/b3QIqPk7bj

Best regards,
Anton.

@Richard50640690 Okay I see, did you receive this email from our Customer Care department? If so please respond to their latest email without editing the subject line if you have any complaints/questions.

Best regards,
Anton.

@madsvetter Hi, our Customer Care department have longer than usual handling times at the moment and we apologize for that. They will contact you by email regarding your claim as soon as possible.

Best regards,
Anton.

@ILikeBonhoeffer Hello, there might be a different booking reference that you use to check-in than the booking reference that the travel agency uses to locate your booking in their systems. Please contact the travel agency to ask for your airline booking reference.

Best regards,
Anton.

@nervdaller Hej! Om det inte går att omboka biljetten online så behöver hon kontakta vår telefonsupport under kundtjänstens öppettider, eller be om hjälp med ombokningen på flygplatsen. Ombokning kan göras fram till 1 timme före planerad avresa.

Med vänlig hälsning,
Anton.

@Richard50640690 Hello, in general the damaged baggage report must be made at the airport with baggage service. If you noticed the damage after you had already left the airport, please try calling baggage service https://t.co/ZV9bTO3uo2 for help with the report.

Best regards,
Anton.

@AberdeenEpi Hello. At the moment I could not find any information indicating that we will fly directly between ABZ-CPH in May unfortunately.

Best regards,
Anton.

@sakalsanfran Hello, I'm sorry to hear about the long handling time for your case. Please contact us on FB Messenger or livechat https://t.co/b3QIqPk7bj with your 7-digit case ID and we can send a reminder to our Customer Care.

Best regards,
Anton.

@standaardmeid Hello!
If you have booked the ticket directly via SAS, it should not be a problem to find the booking as long as you have the correct reference. Please contact us again when you have double checked the information and we will do our best to help you.

Kind regards, Anja!

@Kurantieo Hello 
We work closely with international authorities and regulators. One of these is EASA – the European Union’s Aviation Safety Agency. SAS has chosen to follow EASA’s recommendations, and one of these is the advice to wear face masks when traveling. 

Kind regards, Anja!
